import React from 'react';






const Music = (props) => {
return(
    <div className='music'>
        <center><h1>MUSIC</h1>
            <img src='https://www.pinclipart.com/picdir/big/62-621833_work-in-progress-clipart.png'/>
            <iframe src="https://open.spotify.com/embed/playlist/37i9dQZF1DXe6bgV3TmZOL" width="300" height="380"
                    frameBorder="0" allowTransparency="true" allow="encrypted-media"></iframe>
        </center>
        </div>
    

)
}

export default Music;
